import { Route, Routes} from 'react-router-dom';
import {React} from 'react';
import Header from './Header';
import Footer from './Footer';
import Main from './Main';

export default function App() {

    return(
        <>
        <Header/>
        <div>
            <Routes>
                <Route path="" element={<Main/>}/>
            </Routes>
        </div>
        <Footer/>
        </>
    )
}
